window.bookSummaryJSON = "<p>Jeff Kinney's Wimpy Kid series is a publishing phenomenon, having reached number-one on the <i>New York Times</i> best-seller list. This fourth hilarious installment finds Greg Heffley approaching summer vacation with a clear plan: Stay inside and play as many video games as possible. Unfortunately for Greg, his mother has a much different idea about how the summer will transpire - she envisions lots of outdoor activities and \"family togetherness\".</p>"; 
